import React from "react";
import "./Navbar.css";
const Navbar = () => {
  return (
    <div className="Navbar">
      <nav>
        <h1>Discord</h1>
        <ul>
          <li>Download</li>
          <li>Nitro</li>
          <li>Safety</li>
          <li>Support</li>
          <li>Blog</li>
          <li>Careers</li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
